import React from 'react'
import "./FollowersCard.css"
import { Followes } from '../../data/followersData'

const FollowersCard = () => {
  return (
    <div className='FollowersCard'>
      <h3>Who is Following you</h3>

      {Followes.map((follower,index))}
    </div>
  )
}

export default FollowersCard
